import { useEffect, useState } from "react";
import ApiFunctions from "../ApiFunctions";
import Header from "./Header";
import Footer from "./Footer";
import useToken from "./admin/useToken";
import { useHistory } from "react-router";

import { Helmet } from "react-helmet";



const MyAppointments = () => {

    const history = useHistory();
    const token = useToken();


    if (!token.token) {
        history.push('/');
    }

    const [list, setList] = useState([]);
    useEffect(() => {
        ApiFunctions.myAppointment(null,{
               headers:{
                'Authorization': token.token.token,
               }
        }).then(res => {
            var data = res.data.data;
            setList(data)
        })
    }, []);

    console.log(list);
   
    return (
        <div className="">
            <Header />
            <Helmet>
				<link rel="stylesheet" href={require('../css/style.css').default} />
			</Helmet>


            <section class="home_1 ap_img1">
            <div class="container">
                <div class="heading">
                    <h1>My Appointments</h1>
                </div>
            </div>
        </section>
    <section class="patient_detail">
        <div class="container">
            <div>
                <a href="/#/book-appointment">Book Appointment</a>
            </div>
            <div class="heading">
                <h2>My Appointments</h2>
            </div>
            <div class="patient_table">
                <table>
                    <tbody>
                        <tr class="appointment_history">
                            <td class="productname_td">S.No.</td>
                            <td class="productsize_td">Name</td>
                            <td class="productsize_td">Email</td>
                            <td class="productsize_td">Contact</td>
                            <td class="productsize_td">Doctor</td>
                            <td class="quantity_td">Status</td>
                            <td class="subtotal_td">Appointment DateTime </td>
                        </tr>

                        {list.map((data,id) => {
                     return(
                        <tr class="appointment_history">
                            <td class="productname_td">{id}</td>
                            <td class="productsize_td">{data.name}</td>
                            <td class="sellingprice_td">{data.email}</td>
                            <td class="sellingprice_td">{data.contact}</td>
                            <td class="sellingprice_td">{data.contact}</td>
                            <td class="quantity_td">{data.status}</td>
                            <td class="subtotal_td">{data.appointment_date} at {data.appointment_time}</td>
                        </tr>

                        )})} 
                      

                       
                    </tbody>
                </table>
            </div>
        </div>
    </section>

    <Footer />
               
        </div>
    );
}

export default MyAppointments;
